We’ve never stayed for #KnottsSummerNights but last night we did! 

Thanks @knottsberryfarm for always putting in the work. 

@shelbycribbs_00 @holycrowjazzband

We’re calling this “Courtney’s #Boba Tour Of #Burbank!” 

She’s a huge fans of boba, and so we decided to take a tour of all her go-to places for boba in Burbank. And even though one came out on top that day, she really did like them all!! 

And yes I see that typo @ballersandbrew…sorry!! Lol

